interface IconProps {
    name: keyof typeof iconPaths;
    size?: number;
    color?: string;
    className?: string;
}

const MenuIcon = ({name, size = 24, color = "#019AEC", className = ""}: IconProps) => {
    const iconData = iconPaths[name];

    if (!iconData) {
        console.warn(`Icon "${name}" not found`);
        return null;
    }

    return (
        <div className="flex-shrink-0 w-6 h-6  rounded flex items-center justify-center">
            <svg
                xmlns="http://www.w3.org/2000/svg"
                width={size}
                height={size}
                viewBox={iconData.viewBox}
                fill="none"
                className={className}
            >
                {iconData.paths.map((path, index) => (
                    <path
                        key={index}
                        d={path}
                        fill={color}
                        strokeWidth="0"
                    />
                ))}
            </svg>
        </div>
    );
};

export default MenuIcon;